pragma solidity 0.8.14;

import './interfaces/TokenInterfaceV5.sol';
import './interfaces/StorageInterfaceV5.sol';
import './interfaces/GNSPairInfosInterfaceV6.sol';
import './interfaces/PairsStorageInterfaceV6.sol';
import './interfaces/VaultInterfaceV5.sol';

import '@openzeppelin/contracts/proxy/Clones.sol';

contract KravFactory {

    struct Quanto {
        address tokenT;
        address storageT;
        address pairInfoT;
        address pairStorageT;
        address tradingT;
        address callbackT;
        address rewardT;
        address vaultT;
        address priceAggregatorT;
    }

    address immutable storageT;
    address immutable pairInfoT;
    address immutable pairStorageT;
    address immutable tradingT;
    address immutable callbackT;
    address immutable rewardT;
    address immutable vaultT;
    address immutable priceAggregatorT;

    mapping(uint => Quanto) public quantos;
    uint256 public quantosCount;

    event QuantoCreated(uint256, address, address, address, address, address, address, address, address);

    constructor(
        address _storageT,
        address _pairInfoT,
        address _pairStorageT,
        address _tradingT,
        address _callbackT,
        address _rewardT,
        address _vaultT,
        address _priceAggregatorT
    ) {
        storageT = _storageT;
        pairInfoT = _pairInfoT;
        pairStorageT = _pairStorageT;
        tradingT = _tradingT;
        callbackT = _callbackT;
        rewardT = _rewardT;
        vaultT = _vaultT;
        priceAggregatorT = _priceAggregatorT;
    }

    function createQuanto(TokenInterfaceV5 _token, TokenInterfaceV5 _linkToken, address[] calldata _nodes, int proportionBTC) external {
        Quanto memory quanto;

        quanto.tokenT = address(_token);
        quanto.storageT = Clones.clone(storageT);
        quanto.pairInfoT = Clones.clone(pairInfoT);
        quanto.pairStorageT = Clones.clone(pairStorageT);
        quanto.tradingT = Clones.clone(tradingT);
        quanto.callbackT = Clones.clone(callbackT);
        quanto.rewardT = Clones.clone(rewardT);
        quanto.vaultT = Clones.clone(vaultT);
        quanto.priceAggregatorT = Clones.clone(priceAggregatorT);

        StorageInterfaceV5 _storage = StorageInterfaceV5(quanto.storageT);
        GNSPairInfosInterfaceV6 _pairInfo = GNSPairInfosInterfaceV6(quanto.pairInfoT);
        PairsStorageInterfaceV6 _pairStorage = PairsStorageInterfaceV6(quanto.pairStorageT);

        _storage.initialize(_token, _linkToken);
        _pairInfo.initialize(_storage);
        _pairStorage.initialize(1, _storage);
        TradingInterface(quanto.tradingT).initialize(_storage, _pairInfo);
        TradingInterface(quanto.callbackT).initialize(_storage, _pairInfo);
        NftRewardsInterfaceV6(quanto.rewardT).initialize(_storage);
        VaultInterfaceV5(quanto.vaultT).initialize(_storage);
        AggregatorInterfaceV6(quanto.priceAggregatorT).initialize(_nodes, _pairStorage, quanto.rewardT, _storage, address(_linkToken));

        _storage.setPriceAggregator(quanto.priceAggregatorT);
        _storage.addTradingContract(quanto.tradingT);
        _storage.addTradingContract(quanto.callbackT);
        _storage.addTradingContract(quanto.vaultT);
        _storage.setTrading(quanto.tradingT);
        _storage.setCallbacks(quanto.callbackT);
        _storage.setVault(quanto.vaultT);
        _storage.setMaxOpenInterestDai(0, type(uint256).max);

        _pairStorage.addFee(PairsStorageInterfaceV6.Fee("crypto", 300000000, 600000000, 60000000, 200000000,1,1500000000000000000000));
        _pairStorage.addGroup(PairsStorageInterfaceV6.Group("crypto",bytes32(0x3465633339336163316565343438356639366563373336343666363565373436),2,150,15));
        _pairStorage.addPair(PairsStorageInterfaceV6.Pair("https://api.coingecko.com/api/v3/simple/price?ids=bitcoin&vs_currencies=usd","bitcoin,usd",PairsStorageInterfaceV6.Feed(address(0x5741306c21795FdCBb9b265Ea0255F499DFe515C),address(0),PairsStorageInterfaceV6.FeedCalculation.DEFAULT,20000000000), 400000000,0,0,proportionBTC));

        _linkToken.transfer(quanto.priceAggregatorT, 0.1 ether);

        uint256 _index = quantosCount++;
        quantos[_index] = quanto;
        emit QuantoCreated(_index, address(_storage), address(_pairInfo), address(_pairStorage), quanto.tradingT, quanto.callbackT, quanto.rewardT, quanto.vaultT, quanto.priceAggregatorT);
    }

}
